import React, { Component } from "react";

export default class InputPartyNameField extends Component {
  constructor(props) {
    super(props);

    this.state = {};


  }

  render() {
    return (
      <div>
        <input
          type="text"
          className="mb-2"
          //value={}
          placeholder= "Enter Party Name" //{this.props.placeholderfrom}
          autoComplete="off"
          maxLength="30"
          minLength="5"
          onChange={e => {
            this.props.callbackFromParent(e.currentTarget.value);
            this.props.checkFromParent(e.currentTarget.value);
          }}
          required
        />
      </div>
    );
  }
}
